Information
------------------------------

A Very British Brothel
An estimated one in ten British men regularly pay for sex. In the heart of Sheffield is the so-called golden mile of sex, with the highest concentration of massage parlours in the city. A Very British Brothel reveals the day-to-day workings of the only parlour in the street run by a mother and daughter duo. 
Operating in a converted pub, their premises specialises in the services of more mature women. The documentary reveals the struggle to fill the daily rota, how the management deal with problem clients, and the lives of the working girls who advertise their services and for whom sex is just a job. With unprecedented access to all areas of this unique and unusual family business, and with contributions from the women who work there, and the paying customers who visit them, it provides an extraordinarily frank look inside a rarely seen world.

